import React from 'react'
import { Link, useParams } from 'react-router-dom'
import { CircularProgress } from '@material-ui/core'
import axios from 'axios'
import { useEffect, useState } from 'react'

import SidebarDeps from '../SidebarDeps/SidebarDeps'
import './Sidebar.css'
import TreeView from 'react-treeview';
import 'react-treeview/react-treeview.css'

export default function Sidebar() {
  const [deps, setDeps] = useState([])
  const [users, setUsers] = useState([])
  const [isFetching, setIsFetching] = useState(false)
  const [filterDeps, setFilterDeps] = useState([])
  const currentUrl = useParams().username
  const localUser = JSON.parse(localStorage.getItem('user'))

  const dataSource = [

    {
      type: 'Служба поддержски продуктовых систем розничного бизнеса',id:1,
      collapsed: false,
      child: [
          {name: 'Отдел администрирования бэк-офисных систем розничного бизнеса',collapsed: false,id:2},
          {name: 'Отдел круглосуточной поддержски процессов закрытия операционного дня отчетности розничного бизнеса', collapsed: false,id:3},
          {name: 'Отдел сопровождения активных операций ФЛ', collapsed: false,id:4},
          {name: 'Отдел сопровождения пассивных операций ФЛ', collapsed: false,id:5}
      ],
    },
    {
      type: 'Служба поддержски централизованных и технологических процессов',id:6,
      collapsed: false,
      child: [
          {name: 'Отдел поддержски обмена с ФОИВ', collapsed: false,id:7},
          {name: 'Отдел поддержски систем электронного хранения', collapsed: false,id:8},
          {name: 'Отдел поддержски технологиеских процессов',id:9,
      child: [
          {name:'Группа поддержки зарплатных проектов',id:10,collapsed: false},
          {name:'Группа поддержки логичесих карт и технологических сервисов',id:11, collapsed: false}]}
      ],
    },
    {
      type: 'Служба сопровождения муниципальных и специальных сервисов',id:12,
      collapsed: false,
      child: [
          {name: 'Отдел сопровождения муниципальных проектов', collapsed: false,id:13},
          {name: 'Отдел сопровождения специальных сервисов', collapsed: false,id:14}
      ],
    },
    {
      type: 'Служба сопровождения операционной и расчетной деятельности',id:15,
      collapsed: false,
      child: [{name: 'Отдел поддержки пользователей прочих АБС', collapsed: false,id:16},
          {name: 'Отдел систем доставки электронных документов',id:17,
      child: [
          {name:'Группа поддежрски SWIFT/КФТ/TELEX',id:18}]},
          {name: 'Отдел сопровождения АБС ЮЛ, систем расчетов и задач Казначейства',id:19,
      child: [
          {name:'Группа интеграции с внешними системами',id:20,collapsed: false},
          {name:'Группа поддержки пользователей восточной зоны РФ',id:21,collapsed: false},
          {name:'Группа поддержки пользователей европейской зоны РФ',id:22,collapsed: false},
          {name:'Группа сопровождения систем расчетов',id:23}]},
          {name: 'Отдел сопровождения операционного дня', collapsed: false,id:24},
          {name: 'Отдел специального технологического сопровождения АБС', collapsed: false,id:25},
          {name: 'Отдел управления изменениями', collapsed: false,id:27}
      ]}]



  return (
    <div className='sidebar'>
      <div className="sidebarWrapper">
        <div className="tree">
          <div className="treeWrapper">

            {dataSource.map((node, i) => {

              const label = <Link to={`/department/${node.id}`} className='depsUser' style={{fontWeight: `bold`}}><span className="node">{node.type}</span></Link>

              return (

                  <TreeView key={node.type + '|' + i} nodeLabel={label} defaultCollapsed={true}>

                    {node.child.map(departments => {

                      const label2 = <Link to={`/department/${departments.id}`} className='depsUser'><span className="node">{departments.name}</span></Link>

                      return (

                            <TreeView nodeLabel={label2} key={departments.child} defaultCollapsed={true}>

                              {!!departments.child ? departments.child.map(departments1  => {

                                return(

                                <Link to={`/department/${departments1.id}`} className='depsUser'>

                                  <div className="info" style={{paddingBottom:'8px'}}>{departments1.name}</div>

                                </Link>)
                              }) :''}

                            </TreeView>

                              );
                    })}
                  </TreeView>
              );
            })}
          </div>
        </div>
      </div>
     {/* <SidebarDeps users={users} dep={deps}/>*/}
      <div>

      </div>
    </div>
  )
}
